import React, { useState } from 'react';
import BookingList from './components/BookingList';
import BookingForm from './components/BookingForm';

function App() {
    const [selectedBooking, setSelectedBooking] = useState(null);

    const handleSelectBooking = (booking) => setSelectedBooking(booking);

    const handleFormSubmit = () => {
        setSelectedBooking(null);
    };

    return (
        <div className="App">
            <h1>LIC Reservation System</h1>
            <BookingForm selectedBooking={selectedBooking} onFormSubmit={handleFormSubmit} />
            <BookingList onSelectBooking={handleSelectBooking} onEditBooking={handleSelectBooking} />
        </div>
    );
}

export default App;
